import css from 'styled-jsx/css';

export default css`.carousel {
  border: 1px solid red;
}
.carousel .banner-wrap .banner-item {
  height: 640px;
  width: 1200px;
}
.carousel :global(.td-dot) {
  bottom: 10px;
}
`
